import React, { Component } from 'react';
import './Vasilis.css';
import profilePicture from './me-drawing.png';

const Vasilis = (props) => {
    return (
      <div className="vasilis">
        <img src={props.picture} className="vasilis__picture"></img>
      </div>
    );
}

export default Vasilis;
